import "./MealItemForm.css";

const ItemForm = (props) => {
  return (
    <form className="form">
      label="amount" input={{
        id:"amount",
        type:"number",
        min:"1",
        max:'5',
        step:'1',
        defaultValue:'1'
      }}
      <button>+ ADD</button>
    </form>
  );
};

export default ItemForm;
